// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;


interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
}

contract WalletBalanceChecker {

    address public owner;
    uint256 public expectedChainId = 51;

    mapping(string => IERC20) public tokens;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier correctChain() {
        require(block.chainid == expectedChainId, "Wrong network");
        _;
    }

    constructor() {
        owner = msg.sender;
        tokens["WOOL"] = IERC20(0x80fF8a9A77F78FC413015068a858F7A56848480A);
        tokens["WOOD"] = IERC20(0xfE2f637036B869d7F296708BaAd3622c53f0D97D);
        tokens["ROCK"] = IERC20(0x17864B7bf61073DF9ED6c0ee90f8117687c2ADe6);
        tokens["CLAY"] = IERC20(0xb41E3ce9A37643d7B4a67f62126468F1C6F70364);
        tokens["FISH"] = IERC20(0x61D620473acd26cB76C2867860479C9a18e63020);
    }

    function setExpectedChainId(uint256 _chainId) external onlyOwner {
        expectedChainId = _chainId;
    }

    function checkBalances(address user) external view correctChain returns (uint256[5] memory) {
        uint256[5] memory balances;

        balances[0] = tokens["WOOL"].balanceOf(user);
        balances[1] = tokens["WOOD"].balanceOf(user);
        balances[2] = tokens["ROCK"].balanceOf(user);
        balances[3] = tokens["CLAY"].balanceOf(user);
        balances[4] = tokens["FISH"].balanceOf(user);

        return balances;
    }
}
